import "./styles.css";
import React from "react";
import HourlyRateCalculator from "./HourlyRateCalculator";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hourly Rate Converter</h1>
      </header>
      <HourlyRateCalculator />
    </div>
  );
}

export default App;
